import { jsPDF } from "jspdf";

const months = {
    '01': "Enero",
    '02': "Febrero",
    '03': "Marzo",
    '04': "Abril",
    '05': "Mayo",
    '06': "Junio",
    '07': "Julio",
    '08': "Agosto",
    '09': "Septiembre",
    '10': "Octubre",
    '11': "Noviembre",
    '12': "Diciembre"
}

export function generateCertificate( certificateData ) {
    const doc = new jsPDF(
        {
            format: 'letter',
            margin: {
                top: 0,
                right: 200,
                left: 200,
                bottom: 0
            },
        }
    );
    let images = {
        logoPoli: 'data:image/png;base64,\n',
        signLetter:'data:image/png;base64,',
        footer: 'data:image/png;base64,'
    }
    const dateInfo = certificateData.date.split('-')
    console.log(dateInfo)
    const date = `${dateInfo[2]} de ${months[dateInfo[1]]} de ${dateInfo[0]}`
    doc.setFont('Arial');
    doc.setFontSize(12);
    doc.addImage( images.logoPoli, 'PNG', 10, 10 );
    doc.text( `${certificateData.city}, ${date}`, 140, 50 );
    doc.text( "A quien corresponda, ", 30, 70 );
    doc.text( "Por medio de la presente hacemos constar que", 30, 80 ).setFont(undefined, 'bold');
    doc.text( `${certificateData.name.toUpperCase()}`, 70, 95).setFont(undefined, 'normal');
    doc.text( `Identificado con ${certificateData.id_type} ${certificateData.person_id}` , 75, 100 );
    doc.text( `${certificateData.description}`, 30, 110, { maxWidth: 170, align: "justify" } );
    doc.text( "Extendemos la presente para los fines acadmicos e investigativos pertinentes. Sin ms por el momento estamos a sus rdenes para cualquier duda o aclaracin a la presente.", 30, 140, { maxWidth: 170, align: "justify" } );
    doc.addImage( images.signLetter, 'PNG', 80, 180 );
    doc.text( "Monica Andrea Mantilla Contreras", 110, 205, {  align: "center" } );
    doc.text( "Lder Centro de Investigacin en Innovacin Educativa", 110, 210, {  align: "center" } );
    doc.text( "Politcnico Grancolombiano", 110, 215, {  align: "center" } );
    doc.text( "mmantillac@poligran.edu.co", 110, 220, {  align: "center" } );
    doc.addImage( images.footer, 'PNG', -10, 243 );
    doc.save( "certificado.pdf" );
}